"use strict";export function isPasswordValid(t){const n=/[A-Z]/.test(t),e=/[a-z]/.test(t),o=/\d/.test(t),s=/[!@#$%^&*]/.test(t);return t.length>=8&&n&&e&&o&&s}export function formatDateLocalYYYYMMDD(t){const c=t.getFullYear(),n=t.getMonth()+1,e=t.getDate(),o=n<10?"0"+n:String(n),s=e<10?"0"+e:String(e);return`${c}-${o}-${s}`}
